import React from 'react';
import ReactDOM from 'react-dom';
import Provider from '@react/react-spectrum/Provider';
import ProtoShell from './Components/Shell';
import ProtoSideNav from './Components/SideNav';




class SourceList extends React.PureComponent {

  render() {

    return (
      <div>
        <Provider theme='light' style={{"padding-top": "50px;"}}>
          <ProtoShell></ProtoShell>
          <ProtoSideNav></ProtoSideNav>
        </Provider>
      </div>
    )
  }


}

ReactDOM.render(<SourceList />, document.getElementById('root'));
